import React, { Component } from 'react';

class UserItem extends Component {
  constructor() {
    super();
    this.state = {
      id: 'id',
      user: 'mojombo',
      avatar_url: 'https://avatars0.githubusercontent.com/u/1?v=4',
      html_url: 'https://api.github.com/users/mojombo'
    };
  }

  render() {
    return <div></div>;
  }
}

export default UserItem;
